import vCard from 'vcards-js';

export function contactDetails() {
    const myHeadshotImageBase64 =
        '';

    const downloadTxtFile = (vcfText) => {
        const element = document.createElement('a');
        const file = new Blob([vcfText], { type: 'text/vcard;charset=utf-8' });
        element.href = URL.createObjectURL(file);
        element.download = 'myFile.vcf';
        document.body.appendChild(element);
        element.click();
    };

    const createVCard = () => {
        // create a new vCard
        const vCardInstance = vCard();

        // set properties
        vCardInstance.firstName = 'Tom';
        vCardInstance.lastName = 'Geoghegan';
        vCardInstance.title = 'React Developer';
        vCardInstance.workPhone = '0407250035';
        vCardInstance.workEmail = 'tomgegs@outlook.com';
        vCardInstance.workAddress.city = 'Brisbane';
        vCardInstance.socialUrls.LinkedIn =
            'https://www.linkedin.com/in/thomas-geoghegan';
        vCardInstance.socialUrls.Github = 'https://github.com/TomGegs';

        vCardInstance.url = 'https://tomg-portfolio.netlify.app/';
        vCardInstance.photo.embedFromString(
            myHeadshotImageBase64,
            './src/assets/images/myHeadshot.webp'
        );

        // Return the vCard as a formatted string
        return vCardInstance.getFormattedString();
    };
    return {
        createVCard,
        downloadTxtFile,
    };
}

export default contactDetails;
